import React, { Component } from 'react';

class Task extends Component {
    constructor(props) {
        super(props);

        this.state = {
            date: this.props.date,
            // dueDate = this.props.dueDate,
            content: this.props.content,
        }
    }

    render() {
        return (
            <li>
                <div className="Task" key={this.state.date}>{this.state.content}</div>
            </li>
        )
    }
}

export default Task;
